import Vue from 'vue';
import VueRouter from 'vue-router';

Vue.use(VueRouter);

const routes = [
  {
    path: "/",
    name: "Home",
    component: () => import("@/views/auth/loginView.vue").catch(e => unknownError)
  },
];

const router = new VueRouter({
  routes,
});

export default router;
